import React from 'react';
import './posts.css';
import imac from '../../images/imac.png';
import iphone from '../../images/iphone.png';
import ipad from '../../images/ipad.png';
import macbook from '../../images/macbook.png';

function Posts() {
    return (
        <div className='posts_container'>
            <div className="">
                <img src={iphone} alt="" />
                <h4>120$</h4>
                <h3>Iphone 13</h3>

            </div>
            <div className="">
                <img src={macbook} alt="" />
                <h4>300$</h4>
                <h3>Macbook pro 14</h3>
            </div>
            <div className="">
                <img src={ipad} alt="" />
                <h4>160$</h4>
                <h3>Ipad pro</h3>
            </div>
            <div className="">
                <img src={imac} alt="" />
                <h4>1000$</h4>
                <h3>Imac</h3>
            </div>
        </div>
    )
}

export default Posts
